CREATE TABLE IF NOT EXISTS UNEP_Projects (
    `ProjectID` INT primary key,
    `Project_Title` VARCHAR(255) CHARACTER SET utf8,
    `PAAS_Code` VARCHAR(255) CHARACTER SET utf8,
    `Approval_Status` VARCHAR(255) CHARACTER SET utf8,
    `Fund` VARCHAR(255) CHARACTER SET utf8,
    `PAG_Value` INT,
    `Start_Date` DATETIME,
    `End_Date` DATETIME,
    `Country_ies` VARCHAR(255) CHARACTER SET utf8,
    `Lead_Org_Unit` VARCHAR(255) CHARACTER SET utf8,
    `Theme_s` VARCHAR(255) CHARACTER SET utf8,
    `Donor_s` VARCHAR(255) CHARACTER SET utf8,
    `Total_Expenditure` INT,
    `Total_Contribution` INT,
    `Total_Contribution_Total_Expenditure` INT,
    `Total_PSC` INT
);

